import React from 'react';
import { StyleSheet, Text, View, TextInput, TouchableOpacity, Image } from 'react-native';
import { FontAwesome } from '@expo/vector-icons';
import * as Constant from './Constant';
import AppleHealthKit from 'rn-apple-healthkit';

export default class Main extends React.Component {
  state={
    email:"",
    password:""
  }

  handleHealthKit = () => {
    let options = {
      permissions: {
        read: ["Height", "Weight"],
        write: ["Height", "Weight"]
      }
    };
    AppleHealthKit.initHealthKit(options, (err, results) => {
      if (err) {
          console.log("error initializing Healthkit: ", err);
          return;
      }

      // Height Example
      AppleHealthKit.getDateOfBirth(null, (err, results) => {
        console.log(results)
      });
    });
  }

  render(){
    return (
      <View style={styles.container}>
        <Image
          style={styles.logoImg}
          source={require('./assets/logo.png')}
        />
        <FontAwesome.Button name="instagram" style={styles.loginBtn} onClick={() => this.handleHealthKit()}>
          <Text style={styles.loginText}>TEST</Text>
        </FontAwesome.Button>
      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    height: '100%',
    backgroundColor: Constant.COLOR_GREY,
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo:{
    fontWeight:"bold",
    fontSize:28,
    color:Constant.COLOR_RED,
    marginBottom:40
  },
  logoImg: {
    width: 150,
    height: 150,
    marginBottom:40
  },
  inputView:{
    width:"80%",
    backgroundColor:Constant.COLOR_WHITE,
    borderRadius:5,
    height:50,
    marginBottom:20,
    justifyContent:"center",
    padding:20,
    display: 'none'
  },
  inputText:{
    height:50,
    color:Constant.COLOR_GREY,
  },
  forgot:{
    color:Constant.COLOR_GREY,
    fontSize:11
  },
  loginBtn:{
    backgroundColor:Constant.COLOR_FACEBOOK,
    borderRadius:5,
    alignItems:"center",
    justifyContent:"center",
    padding: 15
  },
  loginText:{
    color:"white",
    fontWeight: '700',
    paddingLeft: 20,
    paddingRight: 20
  }
});
